svg.script:
webMI.addOnload(function() {
    // Suponiendo que `data` es el objeto que ya has obtenido o procesado
    // Aquí deberías incluir el código para obtener o definir `data` si aún no lo tienes
console.log("iniciando fetching")
    // Llamada a la función Read_HA usando webMI.data.call
    webMI.data.call("FetchDataFromSQLite", {}, function(response) {
        if (response.error) {
            console.error("Error al llamar a Read_HA:", response.error);
        } else {
            console.log("Respuesta de Read_HA:", response.result);
        }
    });
});
